/*
@author: Eligijus Skersonas
*/
import React from "react";
import { Line } from "react-chartjs-2";

const LineChart = () => {
  const labels = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
    "August",
    "September",
    "October",
    "November",
    "December",
  ];

  return (
    <div>
      <Line height={200} width={200} />
    </div>
  );
};

export default LineChart;
